function ackMessage(messageNum){fetch("/messages/ack/"+messageNum,{method:"GET",credentials:"include"}).then(function(response){return response.json()}).then(function(json){console.log(JSON.stringify(json)),doMessage(json)})}function doMessage(json){document.getElementById("msg"+json.msgId).remove()}function goTo(target){window.location=target}function dateInputExists(){let box=document.getElementById("datetimeselect");return null!=box&&box}function makeDatePicker(element,dateTime){element&&flatpickr(element,{enableTime:!0,altInput:!0,altFormat:"F j, Y, h:i K",defaultDate:dateTime})}function calculatedatetimestring(dateTimeString){let datetime;document.getElementById("datetime").value=Date.parse(dateTimeString)}function wordSwap(id,time){let words=["delight","use","wonder","beauti","help"],e=document.getElementById(id),timeout=setInterval(()=>{words.push(words.shift()),e.innerHTML=words[0]},time)}function preLoadDateTimeSelectors(){let dateTimePickers=document.getElementsByClassName("datetimepicker"),dateTime=new Date;Array.prototype.filter.call(dateTimePickers,dateTimePicker=>{makeDatePicker(dateTimePicker,dateTime)})}function preLoadClosers(){let closers;document.querySelectorAll(".closer").forEach(v=>{let e=document.getElementById(v.dataset.closer);v.addEventListener("click",()=>{e.checked=!1})})}function fetchIt(url,cb){fetch(url).then(response=>response.json()).then(response=>cb(response)).catch(err=>err)}function ready(fn){"loading"!==document.readyState?fn():document.addEventListener("DOMContentLoaded",fn)}ready(()=>{preLoadDateTimeSelectors(),preLoadClosers()});